const latestDateSeconds = getTimestamp('2021-07-20').seconds
const covidLatest = raw.filter(data => data.date.seconds === latestDateSeconds)

const covidHistory = {}
raw.forEach(({ date, stateId, stateName, cases, casesNew, vaccineOne, vaccineOnePercent, vaccineComplete, vaccineCompletePercent }) => {
  const daily = { date, cases, casesNew, vaccineOne, vaccineOnePercent, vaccineComplete, vaccineCompletePercent }
  if (stateId in covidHistory) covidHistory[stateId].history.push(daily)
  else covidHistory[stateId] = { stateId, stateName, history: [daily] }
})

const main = async () => {
  // Setup a write-only batch
  const batch = db.batch()
  covidLatest.forEach(data => batch.set(db.collection('covid-latest').doc(data.stateId), data, { merge: true }))
  Object.values(covidHistory).forEach(data => batch.set(db.collection('covid-history').doc(data.stateId), data, { merge: true }))

  // Save data to Firestore
  await batch.commit()
  console.log(`Saved to ${admin.apps[0].options.credential.projectId}\n- ${covidLatest.length} COVID summaries\n- ${Object.values(covidHistory).length} COVID histories`)
  process.exit(0)
}

main().catch(err => console.error(err))
